import React from "react";

function ImageSection(props) {
    if (props.image.includes("https://cdn.discordapp.com/attachments/")) {
        let link = props.image.split(" ").find(substring => substring.startsWith("https"));
    } else {
        let link = "https://image.pollinations.ai/prompt/"+props.image;
    }
    
    return (
        <div style={{heigSht: "600px"}}>
            <img src={link} alt="" className="w-75 mh-100" style={{ objectFit: "contain"}}></img>
        </div>
    );
};
export default ImageSection;
